import ReactDOM from 'react-dom';
import React,{ useEffect, useState } from "react";
import styles from './App.module.css';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
    ArcElement,
  } from 'chart.js';
import { Line } from 'react-chartjs-2';
import { Doughnut } from 'react-chartjs-2';
import faker from 'faker';
import Modal from './Modal';

ChartJS.register(
    ArcElement,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
  );

export const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top'
      },
      title: {
        display: true,
        text: 'Chart.js Line Chart',
      },
    },
  };
  
const labels = ['January', 'February', 'March', 'April', 'May', 'June', 'July'];

export const data2 = {
    labels,
    datasets: [
      {
        label: 'Dataset 1',
        data: labels.map(() => faker.datatype.number({ min: -1000, max: 1000 })),
        borderColor: 'rgb(255, 99, 132)',
        backgroundColor: 'rgba(255, 99, 132, 0.5)',
      },
      {
        label: 'Dataset 2',
        data: labels.map(() => faker.datatype.number({ min: -1000, max: 1000 })),
        borderColor: 'rgb(53, 162, 235)',
        backgroundColor: 'rgba(53, 162, 235, 0.5)',
      },
    ],
  };

export const data1 = {
    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
    datasets: [
      {
        label: '# of Votes',
        data: [12, 19, 3, 5, 2, 3],
        backgroundColor: [
          'rgba(255, 99, 132, 0.2)',
          'rgba(54, 162, 235, 0.2)',
          'rgba(255, 206, 86, 0.2)',
          'rgba(75, 192, 192, 0.2)',
          'rgba(153, 102, 255, 0.2)',
          'rgba(255, 159, 64, 0.2)',
        ],
        borderColor: [
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
          'rgba(153, 102, 255, 1)',
          'rgba(255, 159, 64, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

function App() {
    const [openModal, setOpenModal] = useState(false);
    
    return (
        <body style={{backgroundImage: `url('/bg.png')`, height: '100%'}}>
          <nav>
            <div className={styles.containerFluid}>
              <a className={styles.navbarBrand}>
                <img src="/logo.png" alt="" width={500} />
              </a>
              <div className={styles.header}>
                <ul>
                  <li><a href="index.html">Home</a></li><a href="index.html">
                  </a><li><a href="index.html" /><a href="firstfloor.js">First Floor</a></li><a href="firstfloor.html">
                  </a><li><a href="firstfloor.html" /><a href="secondfloor">Second Floor</a></li><a href="secondfloor.html">
                  </a><li><a href="secondfloor.html" /><a href="thirdfloor">Third Floor</a></li><a href="thirdfloor.html">
                  </a><li><a href="thirdfloor.html" /><a href="fourthfloor">Fourth Floor</a></li><a href="fourthfloor.html">
                  </a></ul>
              </div>    
            </div>
          </nav>
          
        </body>
      );
}


export default App;
